import React, {Component} from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import Alert from 'react-bootstrap/Alert';
import { Form } from 'semantic-ui-react';
import Button from 'react-bootstrap/Button';
import './resources/Form.css'

class Breathing extends Component{

  saveAndContinue = (e) => {
      e.preventDefault()
      this.props.nextStep()
  }

  back  = (e) => {
    e.preventDefault();
    this.props.prevStep();
}

  render(){
      const { values } = this.props;
      return(
          <Form >
              <Alert variant='danger'> Om du har mycket svårt att andas ring 112. </Alert>

              <h1 className="ui centered">Hur är din allmänna ork?</h1>
              <Form.Field>
                <label>Breathing</label>
                <input placeholder='Age'
                onChange={this.props.handleChange('breathing')}
                defaultValue={values.breathing}
                />
            </Form.Field>
            <Button onClick={this.back}>Back</Button>
            <Button onClick={this.saveAndContinue}>Save And Continue </Button>
          </Form>
      )
  }
}

export default Breathing;
